import React, { Component } from "react";
import Navigation from "./Navigation";
export default class Header extends Component {
  render() {
    return (
      <header className="Header">
        <div className="Header__title"></div>
        <div className="Header__content">
          <Navigation />
        </div>
        <div></div>
      </header>
    );
  }
}
